style.css:
@-moz-document url-prefix("https://yandex.kz/pogoda") {
#content_right .adv,
    .content__adv,
    .card__day-info .adv,
    .card + .adv-ecom,
    .climate-calendar-container__adv-wide,
    .content__section.content__section_type_adv,
    .weather-maps__ad-content,
    #adv-main,
    #adv-middle,
    #adv-bottom {
        position: fixed;
        top: -1000px;
        left: -2000px;
    }
}

@-moz-document domain("gismeteo.kz") {
.column1 .section.section-media,
    .column2 .section.section-media,
    .column2 .section.section-rss,
    .top-media-placeholder {
        position: fixed;
        top: -1000px;
        left: -2000px;
    }
}

@-moz-document domain("meteoclub.kz") {
body > table table table table tr:nth-child(2) table {
        position: fixed;
        top: -1000px;
        left: -2000px;
    }
}
